	var _project = function() {
		cy = cytoscapeutil.showDataInCytoscape($("#graph"), data2, "dagre");
		cy.expandCollapse({
			animate: false
		});
		var api = cy.expandCollapse('get');
//		api.setOptions({
//			layoutBy: {
//				name: "dagre"
//			}
//		})
		api.collapseAll();
		
		cy.layout({
			name: "dagre"
		}).run();
		var test = new Map();
		cy.nodes().on("expandcollapse.afterexpand", function(event) {
			var node = this;
			console.log(node.id())
			if(test.get(node.id()) == true) {
				var children = cy.elements('node[parent="' + node.id() + '"]')
				children.layout({
					name: "preset"
				}).run();
			} else{
				var children = cy.elements('node[parent="' + node.id() + '"]')
				children.layout({
					name: "dagre"
				}).run();
				test.set(node.id(), true);
			}
		})
	};
	var _showImg = function() {
		$("#showImg").click(function() {
			console.log("showImg");
			cytoscapeutil.showImg(cy, "entry-png-eg");
		})
	}
	var _clearMemo = function() {
		$("#clearMemo").click(function() {
			console.log("clearMemo");
			if (cy == null) {
				return;
			}
			cy = cytoscapeutil.refreshCy(cy);
			cy.expandCollapse();
//			var api = cy.expandCollapse('get');
//			api.collapseAll();
		});
	};

	return {
		init : function() {
			_project();
			_showImg();
			_clearMemo();
		}
	}
